};

return msg;

msg.speech = 'I can help you check Sun Tran bus and Sun Link streetcar departure times. Which bus route?';
msg.wantEndSession = false;
return msg;

var utcOffset = -7 * 3600000;
var now = new Date(Date.now() + utcOffset);

function joinTimes(departures) {
    if (!departures || departures.length == 0) {
        return 'ended';
    }

    for (var i = 0; i < departures.length; ++i) {
        var targetTime = departures[i].split(' ');
        var t = new Date(now);
        t.setHours(parseInt(targetTime[0], 10) + (targetTime[2] == 'PM' && targetTime[0] != 12 ? 12 : 0));
        t.setMinutes(parseInt(targetTime[1], 10));
        var remaining = Math.floor((t - now) / 60000);
        if (remaining >= 0) {
            return '' + remaining + 'min';
        }
    }

    return 'ended';
}

msg.payload = {};
msg.payload.L1 = msg.route + ' ' + msg.stopFullName;
msg.payload.L2 = msg.stopInfos[0][1][0] + ' ' + joinTimes(msg.departures1);
