    msg.payload.L2 += ' ' + msg.stopInfos[1][1][0] + ' ' + joinTimes(msg.departures2);
}

return msg;

var intentName = msg.input.request.intent.name;

function getSlot(slotId) {
    var slot = msg.input.request.intent.slots[slotId];
    if (slot && slot.value != '?') {
        return slot.value;
    }
    return null;
}

