    route = msg.alexaSession.route;
}
if (route) {
    route = route.toLowerCase();
    if (route.indexOf('link') >= 0 || route.indexOf('streetcar') >= 0) {
        route = '700';
    }
}

var stopName = getSlot('stopname');

msg.route = msg.alexaSession.route = route;
msg.stopName = stopName;
msg.wantEndSession = true;

return msg;

msg.speech = 'Which bus route?';
msg.wantEndSession = false;
return msg;

msg.speech = "Which bus stop?";
msg.wantEndSession = false;
return msg;

msg.stopTable = msg.stopTables[msg.route];
