    var b = ' departs ' + msg.stopFullName + ' at ';
    for (var i = 0; i < departures.length; ++i) {
        if (i > 0 && i == departures.length - 1) {
            b += ' and ';
        }
        b += departures[i].replace(' 00 ', ' ') + ' ';
    }
    return b;
}

var routeName = 'route ' + msg.route;
if (msg.route == '700') {
